const PageRouter = ()=>{

    return(
    <Routes>
        
        <Route  path="/login" element={<Login/>} />
        <Route  path="/addofficer" element={<AddOfficer/>} /> 
        <Route  path="/consultation" element={<AddConsultation/>} />
    </Routes>
    )
}



export default PageRouter
